class Solution {
public:
    int helper(int num){
        return num;
    }
    int subarrayGCD(vector<int>& nums, int k) {
        int cnt=0;


        for(int i=0;i<nums.size();i++){
         int res=-1;
            for(int j=i;j<nums.size();j++){
                if(res==-1) res=nums[i];
                if(__gcd(nums[j],res)==k){
                    // cout<<i<<" "<<j<<endl;
                    cnt++;
                }
                res=__gcd(nums[j],res);
            }
        }
        return cnt;
    }
};
